var ctx = canvas.getContext("2d");

var rows = 6;
var cols = Math.floor(Math.sqrt(rows));

var triangle = [];
for (var i = 0; i <= rows; i++) {
  triangle[i] = [];
  for (var j = 0; j <= cols; j++) {
    triangle[i][j] = 1;
  }
}

for (var i = 0; i <= rows; i++) {
  for (var j = 0; j <= cols; j++) {
    ctx.fillRect(j * 10, i * 10, 9, 9);
    ctx.fillText(triangle[i][j].toFixed(2), j * 10 + 4, i * 10 + 4);
  }
}
```
