 Sure! Here's an example of how you could create a React popup component as a module:

1. Create a new React component that renders a popup:
```javascript
import React from 'react';

const Popup = ({ message, onClose }) => (
  <div className="popup">
    <h3>{message}</h3>
    <button onClick={onClose}>Close</button>
  </div>
);
```
2. Create a new module that exports the Popup component:
```javascript
import React from 'react';

const PopupModule = ({ message, onClose }) => (
  <div className="popup">
    <h3>{message}</h3>
    <button onClick={onClose}>Close</button>
  </div>
);

export default PopupModule;
```
3. Import the Popup module in a new file and use it in your React application:
```javascript
import React, { useState } from 'react';
import PopupModule from './PopupModule';

const MyComponent = () => {
  const [open, setOpen] = useState(false);

  const handleClick = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div>
      <button onClick={handleClick}>Show Popup</button>
      {open && <PopupModule message="This is a popup!" onClose={handleClose} />}
    </div>
  );
};
```
